window.bookSummaryJSON = "<p>Making maturity fun again!</p> <p>Dr. Faith explains the fundamentals of adulting in this expanded version of her mini pocket zine. </p> <p>Spoiler: None of the requirements are about having certain jobs, kids, possessions, and debts or being totally bored and stressed out and hating your life. It's hard work to do adult stuff well but the kind of work that's satisfying because it's about being good to yourself and other people and building a life you're okay with waking up to every day. </p> <p>Keep these hot tips around for when you're making big decisions, dealing with difficult situations, or to give to a friend or kid who's making any kind of big life transition. The truth is, adulting is way more fun than kidding. You got this!</p>"; 
